var title_f6_19_6451="Pyogenic granuloma dermoscopy";
var content_f6_19_6451=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F57957&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F57957&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 603px\">",
"   <div class=\"ttl\">",
"    Pyogenic granuloma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 583px; height: 232px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Clinical (left) and dermoscopic (right) image of pyogenic granuloma. On dermoscopy, pyogenic granulomas typically appear as pink homogeneous papules with a white collarette and white intersecting lines representing the fibrous septa seen at histopathology. In a minority of cases, as in the one shown in this picture, a bluish homogeneous structure can be seen. These cases are often clinically and dermoscopically misdiagnosed as melanomas.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Dr. Ashfaq Marghoob.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
