" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Treatment of prosthetic joint infections",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
