"     Elie Berbari, MD, FIDSA",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?6/19/6457/contributors\">",
"     Larry M Baddour, MD, FIDSA",
"    </a>",
"    <br/>",
