var title_f6_19_6460="RTV boosted PI regimens";
var content_f6_19_6460=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F81007&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F81007&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Ritonavir-boosted protease inhibitor-based antiretroviral therapy in treatment-naive patients",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Protease inhibitor",
"       </td>",
"       <td class=\"subtitle1\">",
"        Regimen",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Saquinavir",
"       </td>",
"       <td>",
"        SQV 400 mg bid + RTV 400 mg bid",
"       </td>",
"       <td>",
"        Used infrequently due to poor GI tolerance.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        SQV 1000 mg bid + RTV 100 mg bid",
"       </td>",
"       <td>",
"        Appears to have better pharmacologic profile and is better tolerated than above",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        SQV 1600 mg or 2 gm + RTV 100 mg qd",
"       </td>",
"       <td>",
"        Offers once-daily dosing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Fosamprenavir",
"       </td>",
"       <td>",
"        FPV 1200 mg qd + RTV 200 mg qd",
"       </td>",
"       <td>",
"        The qd boosting regimen is to be used only for treatment na&iuml;ve patients",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        FPV 600 mg bid + RTV 100 mg bid",
"       </td>",
"       <td>",
"        Preferred for protease inhibitor-experienced patients",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lopinavir",
"       </td>",
"       <td>",
"        LPV 400 mg + RTV 100 mg bid",
"       </td>",
"       <td>",
"        Co-formulated as Kaletra",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Atazanavir",
"       </td>",
"       <td>",
"        ATV 300 mg + RTV 100 mg qd",
"       </td>",
"       <td>",
"        Preferred over unboosted ATV 400 mg qd by many experts and necessary when combined with efavirenz or tenofovir. RTV 100 mg does not appear to affect lipid profile.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tipranavir",
"       </td>",
"       <td>",
"        TPV 500 mg bid + RTV 200 mg bid",
"       </td>",
"       <td>",
"        Only approved for use with RTV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Darunavir",
"       </td>",
"       <td>",
"        DRV 800 mg&nbsp;qd + RTV 100 mg qd",
"       </td>",
"       <td>",
"        Highest rate of viral suppression among the boosted PIs, once-daily regimen, and generally well tolerated",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     qd: daily; bid: twice daily; GI: gastrointestinal; RTV: ritonavir.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f6_19_6460=[""].join("\n");
