var title_f6_19_6461="Patient education skills";
var content_f6_19_6461=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F63604&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F63604&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Patient education skills",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_left\" colspan=\"3\" rowspan=\"1\">",
"        Objective 1: Tell a meaningful diagnosis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"3\" rowspan=\"1\">",
"        Step 1 - Ask patient his/her",
"understanding of what the problem or situation is. Or, reflect what",
"you've heard if patient has already stated this.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"3\" rowspan=\"1\">",
"        Step 2 - Tell patient \"You have... (diagnosis)\" or \"The diagnosis is not clear, but I'm concerned about... (list issues).\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"3\" rowspan=\"1\">",
"        Step 3 - Ask patient about his/her reaction.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Ask about",
"       </td>",
"       <td class=\"subtitle2\">",
"        Description",
"       </td>",
"       <td class=\"subtitle2\">",
"        Examples",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Knowledge",
"       </td>",
"       <td>",
"        Teach patient about diagnosis. Inquire about patient's understanding of your news. Regulate quantity and level of information.",
"       </td>",
"       <td>",
"        \"What do you already know about this?\" \"What questions do you have?\" \"What do you want to know more about?\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Feelings",
"       </td>",
"       <td>",
"        Inquire about patient's inner state in response to the news, reflect feelings you see/hear (use PEARLS).",
"       </td>",
"       <td>",
"        \"What's your reaction to this?\" \"How are you feeling about this?\" \"You look worried.\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Beliefs/Meaning",
"       </td>",
"       <td>",
"        Inquire about patient's beliefs about why he/she has the problem or what it means.",
"       </td>",
"       <td>",
"        \"Why do you think you have high blood pressure?\" \"What does it mean to you to hear I'm uncertain about...?\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Expectations",
"       </td>",
"       <td>",
"        Inquire about the patient's expectations of future outcomes.",
"       </td>",
"       <td>",
"        \"What do you see happening when you look to the future?\" \"How do you think things will go for you?\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\" colspan=\"3\" rowspan=\"1\">",
"        Objective 2: Negotiate and implement a plan (again use Ask-Tell-Ask format)*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Action",
"       </td>",
"       <td class=\"subtitle2\">",
"        Description",
"       </td>",
"       <td class=\"subtitle2\">",
"        Examples",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ask - existing ideas",
"       </td>",
"       <td>",
"        Find out what he/she has already tried and what ideas he/she has about what the plan should be.",
"       </td>",
"       <td>",
"        \"What have you tried already?\" \"What ideas do you have about what we should do now?\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tell - plan",
"       </td>",
"       <td>",
"        Describe plan, give reasons and expectations, and forecast possible problems.",
"       </td>",
"       <td>",
"        \"I recommend...because...\" \"You can expect...\" \"If...happens, then you should...\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ask - understanding",
"       </td>",
"       <td>",
"        Check patient's understanding and agreement. Inquire about obstacles. Problem-solve and negotiate differences.",
"       </td>",
"       <td>",
"        \"How does this sound to you?\" \"What problems do you anticipate?\" \"Help me understand - what's holding you",
"back?\" \"What would it take for you to be ready?\" \"Let's look together",
"for what might work.\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rehearse",
"       </td>",
"       <td>",
"        Check to be sure your and your patient's understanding of the plan are the same.",
"       </td>",
"       <td>",
"        \"Just to be sure we're clear, what would you tell your spouse (or friend) about our plan?\"",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Caution: Patient's unspoken beliefs, fears or lack of commitment frequently appear as defensiveness, resistance or reluctance. Remember, when defensiveness starts, learning stops. For treatment planning, your understanding of such fears and beliefs is as important as your medical expertise. If you see, hear or feel defensiveness in your patient, go back and focus on relationship building. If you're rushed it is better to schedule another visit than to create frustration.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted with permission from Clark W, Hewson M, Fry M, et al. American Academy on Physician and Patient (AAPP) 1998.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
